import { useEffect,useState} from "react";
import axios from 'axios';
const Main=async()=>{
    const [data,setdata] =useState();
    useEffect(async ()=>{
        const profile =fetch();
        setdata(profile);
    })

    return(<>
        console.log(data);
    </>)

}
async function fetch(){
    const profile = await axios.get(`http://localhost/profile`);
    return profile;
}
export default Main;
